product_desc:
LBVCAMPUS offers non-market services (publication of scholarship offers, internships, competitions dates, academic receipt). The business model is based primarily on the following commercial services:

• Rental of booth online (SalonCampus);
• Sale of advertising space (for advertisers);
• Sale of online courses (for young people: pupils, students).

The most important service releasing large profit margin is advertising for advertisers which represents 73.1% of sales. While leasing is 26.5% and sales of over 0.4%.

We plan after six months of operation of our website to provide our users and the wider youth community web Gabon mobile application (EduCampus) for our customers even more reach their targets.
